class Solution:
    def dfs(self, x, y, visited, sequence):
        self.sequence[x][y] = sequence
        if not visited[x][y]:
            visited[x][y] = 1
            if x < len(sequence) - 1:
                self.dfs(x + 1, y, visited, sequence)
            if y < len(sequence[0]) - 1:
                self.dfs(x, y + 1, visited, sequence)
        return

    def getSequence(self, x, y, sequence):
        if self.sequence[x][y]!= -1:
            return self.sequence[x][y]
        visited = [[0 for _ in range(len(sequence[0]))] for _ in range(len(sequence))]
        self.sequence[x][y] = 0
        self.dfs(x, y, visited, sequence)
        return self.sequence[x][y]


    def minimumLength(self, n: int) -> int:
        self.sequence = [[-1 for _ in range(n)] for _ in range(n)]
        visited = [[0 for _ in range(n)] for _ in range(n)]
        return self.getSequence(0, 0, self.sequence)


