class BinaryTree():
    def __init__(self):
        self.root = None
        self.size = 0

    def find(self, key):
        if self.root == None:
            return None
        else:
            if self.root.key == key:
                return self.root
            elif self.root.key < key:
                return self.root.right.find(key)
            elif self.root.key > key:
                return self.root.left.find(key)

    def insert(self, key, value):
        if self.root == None:
            self.root = Node(key)
            self.size += 1
            return True
        else:
            if self.root.key == key:
                self.root.value = value
                return True
            elif self.root.key < key:
                self.root.right = BinaryTree()
                self.root.right.insert(key, value)
                self.size += 1
                return True
            elif self.root.key > key:
                self.root.left = BinaryTree()
                self.root.left.insert(key, value)
                self.size += 1
                return True

    def delete(self, key):
        if self.root == None:
            return None
        else:
            if self.root.key == key:
                if self.root.right:
                    self.root = self.root.right
                elif self.root.left:
                    self.root = self.root.left
                else:
