from collections import defaultdict

class Solution:
    def solution(self, A):
        m, n = len(A), len(A[0])
        parent = [[0] * n for _ in range(m)]
        distances = [float('inf')] * m
        visited = [False] * m
        queue = []
        for i in range(m):
            for j in range(n):
                if A[i][j]!= 0:
                    parent[i][j] = A[i][j]
                    if A[i][j] > 0:
                        distances[i] = A[i][j]
                    queue.append((i, j))
                    visited[i] = True

        def dfs(s, parents):
            if len(queue) == 0:
                return 0

            if not visited[s]:
                return distances[s]

            minimum = float('inf')
            for i, j in queue:
                minimum = min(minimum, parent[i][j] * dfs(i, parents))

            visited[s] = False
            return minimum

        return min(dfs(i, parent) for i in range(m)) + min(dfs(i, parent) for i in range(m))

