class Solution:
    """
    @param n: An integer
    @param S: An integer
    @return: An integer
    """
    def coinChange(self, n, S):
        if n == 0:
            return 0
        dp = [0] * (S + 1)
        dp[0] = 1
        for i in range(1, S + 1):
            dp[i] = self.dfs(n - 1, i, dp)
        return dp[S]

    def dfs(self, n, i, dp):
        if n == 0:
            return 0
        if i == 0:
            return 1
        if dp[i] == 0:
            return 0
        if i == 0:
            return 1
        dp[i] = 0
        if i >= n:
            return 0
        if i <= 0:
            return 1
        for j in range(i, n):
            dp[i] += self.dfs(n - 1, j, dp)
        return dp[i]

