class Solution:
    def longestPalindrome(self, s: str) -> str:
        longest = ''
        for i in range(len(s)):
            left = self.helper(s, i, i)
            right = self.helper(s, i, i + 1)
            for j in range(left, right):
                if s[j]!= s[j - left]:
                    break
                else:
                    if len(longest) < len(s[j]):
                        longest = s[j]
        return longest

    def helper(self, s, left, right):
        while left >= 0 and right < len(s) and s[left] == s[right]:
            left -= 1
            right += 1
        return right - left - 1

