import math

from collections import Counter


class Solution:
    def check(self, numbers, k):
        for i in numbers:
            if not 1 <= k - i <= math.sqrt(k) + 1:
                return False
        return True

    def get_subsets(self, nums, k):
        return set(
            [
                list(range(i * k, i * k + k))
                for i in range(1, len(nums) + 1, 1)
                if self.check(nums[i: i * k + k], k)
            ]
        )

    def nCr(self, n, r):
        return math.factorial(n) // (math.factorial(n - r) * math.factorial(r))

    def num_partitions(self, k):
        n, n_list = len(nums), Counter(nums)
        if not 1 <= k - n_list[k] <= math.sqrt(k) + 1:
            return 0

        return (
            len(
                list(self.get_subsets(nums[: n], k))
                + list(self.get_subsets(nums[n * k:], k))
            )
            // n_list[k]
        )

