class Solution:
    def solution(self, stdin: str) -> str:

        def subProblem(s, n, m):
            if n < m:
                return s[:m] + s[m:]
            else:
                if s[n] == '0':
                    return s
                else:
                    return s[:n] + '1' + subProblem(s, n+1, m) + '0'

        return subProblem(stdin, 0, len(stdin)-1)


